#[near_bindgen]
#[derive(Default, BorshDeserialize, BorshSerialize)]
pub struct Counter { val: i8,
} near_bindgen here means that the contract's state comes from this struct. derive is a built in macro. Each item passed to derive is a trait : The Default trait has a single default method, which returns a default instance of a type. BorshDeserialize generates a deserialize method, so contract state can be read from storage. BorshSerialize generates a serialize method, so contract state can be written to storage. If you're interested, expand this section to see the code the above `derive` macro will generate. impl ::core::default::Default for Counter { #[inline] fn default() -> Counter { Counter { val: ::core::default::Default::default(), } }
}
impl borsh::de::BorshDeserialize for Counter
where i8: borsh::BorshDeserialize,
{ fn deserialize(buf: &mut &[u8]) -> ::core::result::Result<Self, borsh::maybestd::io::Error> { Ok(Self { val: borsh::BorshDeserialize::deserialize(buf)?, }) }
}
impl borsh::ser::BorshSerialize for Counter
where i8: borsh::ser::BorshSerialize,
{ fn serialize<W: borsh::maybestd::io::Write>( &self, writer: &mut W, ) -> ::core::result::Result<(), borsh::maybestd::io::Error> { borsh::BorshSerialize::serialize(&self.val, writer)?; Ok(()) }
}

